@nặng
- 1 d. Tên gọi một thanh điệu của tiếng Việt, được kí hiệu bằng dấu " . ". Thanh nặng. Dấu nặng.
- 2 t. 1 Có trọng lượng bao nhiêu đó. Bao gạo nặng 50 kilogram. Cân xem nặng bao nhiêu. 2 Có trọng lượng lớn hơn mức bình thường hoặc so với trọng lượng của vật khác; trái với nhẹ. Nặng như chì. Gánh bên nặng bên nhẹ. Cành cây nặng trĩu quả. Ăn no vác nặng*. 3 Có tỉ trọng lớn. Chì là một kim loại nặng. Dầu nặng*. 4 Có tác dụng làm cho cơ thể hoặc tinh thần phải chịu đựng nhiều, đòi hỏi nhiều sự vất vả. Miễn làm công việc nặng. Nhiệm vụ rất nặng. Phạt nặng. 5 Ở mức độ cao, có thể dẫn đến hậu quả tai hại, nghiêm trọng. Bệnh nặng. Bị thương nặng. Máy hỏng nặng. Phạm tội nặng. Hạn nặng quá, lúa khô héo hết cả. 6 (Đất) có nhiều sét, ít tơi xốp, cày cuốc nặng nhọc, vất vả. Chân đất nặng. Bò yếu không cày được ruộng nặng. 7 Có cảm giác khó chịu, không thoải mái, tựa như có cái gì đó đè lên ở một bộ phận nào đó của cơ thể. Đầu nặng mắt hoa. Mắt nặng trịch vì thức trắng hai đêm liền. Ăn phải thức ăn khó tiêu, nặng bụng. Thấy nặng trong lòng (b.). 8 Có tác động không êm dịu đến giác quan, gây cảm giác khó chịu. Giọng miền biển, nặng và khó nghe. Mùi tương thối rất nặng. 9 Có sự gắn bó, thường là về tình cảm, tinh thần, không dễ dứt bỏ được. Tình sâu nghĩa nặng. Nặng lòng với quê hương. Nặng nợ*. Nặng tình*. 10 Tỏ ra chú trọng nhiều đến một phía nào đó, trong khi ít chú ý đến những phía khác. Nặng về lí, nhẹ về tình. Nặng về số lượng, không chú ý chất lượng.

